async () => {
  var ps_d = appsmith.store[trackedPlayerStore.PLAYERS_DATA];
  var curr_p = titledPlayers.triggeredRow.name;
  if (ps_d === undefined) {
    ps_d = {};
    var res1 = await chess_com_player_fromtitle.run().catch(() => {});
    ps_d[curr_p] = res1;
    await storeValue(trackedPlayerStore.PLAYERS_DATA, ps_d);
  } else {
    if ((curr_p in ps_d)) {
      return ps_d[curr_p];
    } else {
      var res = await chess_com_player_fromtitle.run().catch(() => {});
      ps_d[curr_p] = res;
      await storeValue(trackedPlayerStore.PLAYERS_DATA, ps_d);
    }
  }
  return appsmith.store[trackedPlayerStore.PLAYERS_DATA][curr_p];
}

